import ExpenseItem from "./ExpenseItem";
import "./ExpenseList.css";


const ExpenseList=(props)=>{
  if(props.items.length === 0){
    return <h2 className="expenses-list__fallback">Found no expences.</h2>

  /*if(props.items.length > 0){
