          />))*/
          /*Or another way
           {yearFilteredArray.length===0 ? <p>No items found.</p>:yearFilteredArray.map(element => {      
        return(
          <ExpenseItem     
            key={element.id}    
            title={element.title}
            amount={element.amount}
            date={element.date}
        /> )}
      )}          */
  }
  return(props.items.map((element) => (
    <ExpenseItem     
      key={element.id}    
      title={element.title}
      amount={element.amount}
      date={element.date}
        />)));
}

export default ExpenseList;
